import React from "react";
import {
  IonSlides,
  IonSlide,
  IonCardTitle,
  IonImg,
  IonCard
} from "@ionic/react";

const SlideShow = () => {
  const slides = [
    {
      id: 0,
      url: ""
    },
    {
      id: 1,
      url: ""
    },
    {
      id: 2,
      url: ""
    },
    {
      id: 3,
      url: ""
    },
    {
      id: 4,
      url: ""
    }
  ];
  return (
    <IonSlides style={{ width: "100%", height: 200 }} pager={true} options={options} onIonSlideNextStart={(event) => {
        console.log(event.target)
        console.log(event.detail)
    }}>
      {slides.map(({ id, url }) => (
        <IonSlide
          key={id}
          style={{ width: "100%", height: "100%", border: "1px gray dashed" }}
        >
          <IonCard>
            <IonCardTitle>{id}</IonCardTitle>
            <img src={url} />
          </IonCard>
        </IonSlide>
      ))}
    </IonSlides>
  );
};

export default SlideShow;

const options = {
    initialSlide: 0,
    speed: 700,

};
